INSERT INTO reviews (rid, text, rating, timestamp, user_id, res_id)
VALUES (1, 'Bestest oldest authentic Chinese food , must go place', 5, timestamp '2019-11-30T23:31:23+0530', 1, 50),
(2, 'Want to have tasty Chinese and Japanese food? Then try FUJIYA in Chanakyapuri, tried hot and sour and corn soup followed by chilly potato, mojito, spring rolls and after that pan fried noodles with gravy. Delicious food was served and the staff was also polite and respectful, amazing experience at this place. Will visit this place again with my friends.', 4, timestamp '2019-10-30T00:39:14+0530', 2, 50),
(3, 'Fujiya is listed in the legendary restaurants of Delhi.It has been here since decades and I had high expectations from this place.They had a vast menu with a lot of dishes.So we decided to order a veg Sushi platter and pan friend noodles. Their pan fried looked very different than the ones I am used to eating.The noodles were fried,more like choupsey and topped with lots of veggies and greens.The sauce of the veggies was bland,some translucent kind of sauce with no flavours just basic salt and pepper.So the noodles were very disappointing.I have had far better pan fried at other places! Next the sushi also couldn’t impress.Tempura sushi was still ok considering the other ones.Other sushi we didn’t took even a second serving after trying it.We unfortunately couldn’t even finish our meals and left!', 1, timestamp '2020-03-01T16:49:59+0530', 3, 50),
(4, 'The food is as chinjabi as possible. It’s just because of the old school feel you can go to the place.', 3, timestamp '2020-02-03T14:38:57+0530', 4, 50),
(5, 'We ordered sushi, fried rice, chili garlic noodles and Hong Kong chicken. Food was pathetic. Completely not worth going. Strictly a NO NO NO NO NO N if u tell them about it , no body bothers. ', 1, timestamp '2020-01-26T23:04:16+0530', 5, 50),
(6, 'Lost charm. Very bad experience both in food & service. Had gone with family for lunch. 1. Hot & sour chicken soup was tasteless neither spicy not tasty. 2. Chilli garlic noodles had hardly and garlic & was bland. 3. Prawns in hot garlic sauce was like a below average Indian curry with prawns thrown in it. Horrible taste. When I called manager Thakur he was rude and said it is cooked this way only. Anyways had such a bad experience that wanted to make others aware.', 1, timestamp '2020-01-25T20:34:07+0530', 6, 50),
(7, 'Not a good place for chatore indians. then they have their own order of charging service charge which is a obove the Hon''ble Supreme Court. ', 1, timestamp '2020-01-10T19:42:04+0530', 7, 50),
(8, 'Never go there', 1, timestamp '2020-01-10T19:40:57+0530', 8, 50),
(9, 'A lovely restaurant with good ambience. Chilly fish tastes awesome. Must try for all. One of the places to find authentic Chinese soup. I tried Hot&Sour Chicken soup , chili garlic noodles and chicken in hot garlic sauce. Retreat for Chinese people in Delhi 。 。 。 。 。 会 Thumps Up !', 5, timestamp '2019-11-12T21:00:35+0530', 9, 50),
(10, 'Having turned down a couple of times due to a full house, I decided to visit on a Tuesday (when everyone turns vegetarian) evening. Got a warm welcome with a choice of tables even! But in a few minutes, as we were about to dig into our soup, the place was bustling with people waiting outside. So, what’s the fuss all about? It’s the old world feel. It gives you a feeling that it’s been there since ages with a tribe of loyal customers. It’s like nothing has changed and that’s what people love about it. It isn’t cheap by any standards but I guess it’s a great place to grab a beer and munch on an appetiser. A big bottle of Kingfisher is for 300/- . Food: well, it’s nothing special but you can’t fault it. And that’s what brings people back here. You just can’t go wrong. They offer an array of Chinese and Japanese dishes. Some indian dishes quietly slipped in like Gobi Manchurian 😜 I tried the corn and asparagus soup, the chilly baby corn, aromatic pork dumplings, Japanese sticky rice with vegetables. Everything was just right. Right amount of spice, right portion size, fresh ingredients. Quite a homely feel to the place. And the decor coupled with the bustle of the place makes for a good happy outing. Worth a try. ', 4, timestamp '2019-10-30T19:03:12+0530', 10, 50),
(11, 'All time favorite place for me to have such a delicious food of my taste. Love this place food with it''s vast options cable to fulfill your empty belly. Service is too fast ambience also soo good. Love it Instagram {uid:38945158} ', 5, timestamp '2019-06-19T00:03:51+0530', 11, 55),
(12, 'Like the place to have the oriental cuisine. I went to this place with my wife and my daughter. We ordered Chicken Spring Roll: They are crunchy and good option for a starter. Spicy Stir Fry French Beans: Crisp yet not overcooked with the right amount of favoring and went perfectly with the fried rice Zha Jiang noodles: This was the star. Perfect Chinese dish consisting of thick wheat noodles topped with Zhejiang sauce. For drinks, we had virgin Mohito. It was refreshing as it should be. For desserts, We had Brownie zebra: Perfect dessert to satisfy your sweet truth. The service was quick and attentive. I will visit here again.', 5, timestamp '2019-10-26T19:00:45+0530', 12, 55),
(13, 'The ambience of CP’s Berco’s is apparently very appealing. Love the decor. Perfect date place for chinese lovers. I’m a huge fan of their chilli garlic vegetables, the authentic chinese taste. ️ But they really lack in honey chilli potatoes. It either feels too soggy and sweet, or it feels overcooked. I tried it 3 different times but I don’t feel it was a mistake, that is their fixed recipe and it tastes like a sweet dish to me. Service is great here!', 4, timestamp '2020-01-07T17:36:06+0530', 13, 55),
(14, 'I went to cp with my friends fir some party. I saw this outlet of bercos and decided to do a takeaway of some food fir my family. I ordered crispy corn, chilli potatoes, cheese and corn along with a different dish which called sanghai style rice and noodles. Coming to the first, corn were really nice nad crisp with perfect flavours balanced. Chilli potatoes had a nice tangy flavour which made it taste good. Coming to the cheese rolls, they went a little soggy after it was packet but still it was really cheesyyy i must say! , the mixed noodels and too tasted different i would say, ut was something i had never tried before! Overall a nice experience.', 5, timestamp '2020-01-16T23:09:25+0530', 14, 55),
(15, '1. Ordered Prawn Tom Yum Soup, Black Pepper Chicken Dimsums and Garlic & Cheese Wontons. 2. The Tom Yum Soup was excellent with sufficient prawns and the perfect combination of tangy and spicy. 3. The Chicken Dimsums were great with the Garlic & Cheese Wontons being even better. 4. Orders are served reasonably fast. 5. Pricing could have been a bit more reasonable.', 4, timestamp '2020-03-01T20:32:55+0530', 15, 55),
(16, 'The board looks very basic on the outside, but the restaurant interiors are absolutely amazing 😍. Tried the ''Chicken Tom Kha'' and ''Veg Wonton Soup'' which were both amazing. Had the ''Honey Chilli Potatoes'' sans the honey, which was perfect, crisp and spicy. The only disappointment was the ''Chicken Pan Fried Noodles''. The dish was way too oily and the pan frying wasn''t done well, hence the crust wasn''t formed perfectly and the noodles weren''t as crispy at the bottom. The service was a tad bit too slow and very disorganized. They brought in the appetizer before the soup which was very weird. The pricing was perfect though. So overall, would definitely recommend 👍.', 3, timestamp '2020-01-29T19:23:21+0530', 16, 55),
(17, 'No doubt in excellent staff service. Delicious servings and perfect ambience for dine out with family or couple. Best view at corner tables of stairs (Those who are fond of selfies) It is pocket friendly too. Make sure to order their thai rice bowl (Damn delicious) if you are going for heavy meal. Meal.for 2 in 1000 bucks ', 5, timestamp '2019-10-22T09:01:42+0530', 17, 55),
(18, 'Ordered their Three Pepper Bowl which is usually my go to dish. Instead of their noodles, I went for the rice. The only thing I didn’t like about the dish was ‘the quantity of the gravy& Amount of grilled chicken they had put in. I couldn’t complete my rice with it. Had to borrow some spoons of my friend’s Grilled fish in order to eat it all. Though I liked the ambiance, Liked the co-operative staff. 😀', 3, timestamp '2019-12-09T07:34:29+0530', 18, 55),
(19, 'Let the Christmas charm die a Death with Chocolate topping over the Christmas Spirit ✨', 3, timestamp '2019-12-25T15:54:39+0530', 19, 55),
(20, 'If I had to rate just on ambience, I would have given this place 5 star. Such a beautiful place it is. Food is good too but a little bit costly. We ordered Veg Spring Roll and Cold Coffee. Spring Roll tasted good. Not worth the price though. Cold Coffee was okayish. I''ll recommend this place just for the look and feel it projects. ', 3, timestamp '2019-10-13T14:48:22+0530', 20, 55),
(21, 'Colonel’s Kababz in Defence Colony, New delhi has been doing kebabs and curries since about 25 years now and their quality of food is definitely premium. In the picture: Gosht Seekh Kebab (Colonel’s Special) The kebabs were succulent with amazing mutton blend which is very juicy and moist and the chuntey served along went very well with these but I found the kebabs to be a little overpriced, maybe because of the brand name associated to it, the quantity and presentation could be better. @colonels.kababz @colonels_kababz', 3, timestamp '2020-03-19T14:14:57+0530', 21, 60),
(22, 'Food was good but too much salt in the preli dal tarka. so pls just put less salt. because we can alwz add more but cant redduce the salt pls', 3, timestamp '2020-01-14T14:43:05+0530', 22, 60),
(23, 'Very juicy mutton seekh kabab @colonel kabab defence colonel delhi', 5, timestamp '2020-01-10T21:34:35+0530', 23, 60),
(24, 'Rolls are OVER PRIC3D Rs. 200 and are tasteless. Upon complaining staff said ''we find it Ok''. :/ Menu on tomato has different and lower pricing. The menu given this is attached as a pic. Very bad experience ', 1, timestamp '2019-10-12T18:30:08+0530', 24, 60),
(25, 'Although its a old and "Supposedly" a legendary place, tried a Lehsuni Chicken tikka. I Visited the DefCol market itself after ages and really thought of relieving old memories by having their tikka. Unfortunately it was really not upto the taste as it used to be long time back and paying more than 500 bucks for it really hurts.', 2, timestamp '2019-09-15T16:14:49+0530', 25, 60),
(26, 'The Pinner tikka roll was pathetic as it was stale and dry. Paneer was way too hard and it was smelling The green chutney was so bad, it made me puke. It was stinking and had a sour taste. The onions were yellow and stale For 200 rs for a roll, they should at least maintain some hygiene, just because they sit in defence market, doesn’t mean they can sell anything Colonels has rightly lost its charm', 1, timestamp '2019-08-29T22:04:36+0530', 26, 60),
(27, 'I have been to this place once. We ordered chicken tikka roll which was fresh and tasty. In main course we tried Chicken bhayankar which is their speciality. The preparation was good. I liked the quality of chicken they use. The tandoori roti was crispy and the rumali roti was perfectly cooked. Overall I liked their food. The prices are on little higher side. The service is good and quick.', 4, timestamp '2019-08-21T19:58:46+0530', 27, 60),
(28, 'The place is easy to locate but once you get there and order food that is where you start to get disappointed, the sizes of each portion are very small and do not provide enough value for the money that is being paid। Rating: Taste 6/10 Service 6/10 (just because they bring the food till your car) Value for money 2/10', 2, timestamp '2019-08-21T09:25:52+0530', 28, 60),
(29, 'Well this place is overpriced and the food is highly overrated. Spent quite a lot of money for nothing and honestly speaking what’s the price for ? Very very disappointed would suggest people to go to Al Nawaz or other restaurants that are far better than this place. Thank you. ', 1, timestamp '2019-07-24T22:45:50+0530', 29, 60),
(30, 'Ever since the seating has been sealed , this outdoor serving restaurant has gone to the dogs and quite literally . From being my favourite go to place for Kebabs ever since I was a kid it has now become a place which has the worst possible service levels and poor hygiene. With barely 3 outdoor high tables ( and about 5 cars in which people drink and eat ) , the serving staff is rude and disrespects patrons . The serving time for orders has increased surprisingly as they are focusing more on the delivery business . A terrible experience . Would not recommend to anyone looking for a pleasant experience . ', 1, timestamp '2019-06-30T16:39:22+0530', 30, 60),
(31, 'When I first saw the facade of this place I was awestruck and knew I had to check this place out. After entering I didn''t wanted to leave this place anytime soon. The interior is just beautiful. I ordered their "Chilly Garlic Prawns". The presentation was really nice and it was a delight to eat. The flavours were balanced and every flavour was distinct. Really amazing place to chill.', 5, timestamp '2020-02-26T00:10:18+0530', 31, 65),
(32, 'The ambience of this place is too attractive to see. Chilli basil cottage cheese is too good of this place . It had ample of sitting area, which is comfortable too. The staff members of this place take care of each and every need of the customers taste and preference. I liked this place a lot. ', 5, timestamp '2020-01-26T21:59:14+0530', 32, 65),
(33, 'I had visited to this place yesterday in the evening to have a delicious food here. The ambience of this place is too good to see. There was polite and alert staff here. Here i had tried: Chilli garlic lotus root Orange chilli prawns Fluffy steamed rice Kung bao chicken All the food stuff was too delectable special the orange chilli prawns. The quality of the food was upto the mark. HIGHLY RECOMMEND', 5, timestamp '2020-01-26T21:56:13+0530', 33, 65),
(34, 'Regular run of the mill buffet food. Taste wise it was OK but not there to beat some good food The drinks with buffet are just one per person which is a let down', 3, timestamp '2019-09-30T15:17:48+0530', 34, 65),
(35, 'I had been to this place with my friends to have some Chinese cuisine. First of all soups and salad varieties was damn good. It has a great ambience. Indoor sitting area is simple fabulous. Staff is very friendly and courteous. Service was prompt. We had ordered Chilli Honey Potato Veg Spring Roll Virgin Mojito and Butter Scotch Ice Cream Shake. All the ice-cream shakes and drinks are outstanding. I really like their menu. I really enjoyed over here with my friends and will definitely keep visiting.', 5, timestamp '2020-03-18T11:00:55+0530', 35, 65),
(36, 'This is a dine-in outlet bar. It serves all kinds of Asian, Thai, Chinese and Sea Food. I recently visited this place and ordered some momos from here. They were utterly delicious😋 The service was good and the ambience was great. The price of the dishes were totally worth the taste. J thoroughly enjoyed myself here and will surely recommend this place to everyone!', 5, timestamp '2020-03-17T21:54:27+0530', 36, 65),
(37, 'Has an amazing tune with friends at this fabulous place. Love the decor, ambience, vibes, food and the staff was courteous. The order was served on time. We ordered Fried rice Kind pao chicken 3 spice chicken chilli honey potato All these dishes are a must try for all the foodies out there📍 Highly recommended , with great decor and really yummy dishes that too at affordable prices❤', 5, timestamp '2020-03-16T20:42:29+0530', 37, 65),
(38, 'This is really good place to have food from the food is really good the taste is yummy the quality is really good to have food was very yummy and delicious the delivery was done on time food was very tasty and delicious the packing was very good and safe had drums of heaven and drunken chicken which was very good to have over all good experience of ordering food from here a must try place', 5, timestamp '2020-03-16T20:18:15+0530', 38, 65),
(39, 'We were looking for a place to visit in the evening a few days ago, then we found this restaurant named Drums of heaven and visited this restaurant. This place is quite famous for it''s food. We did lunch here. The food here is very good. Drums of heaven and chillli potatoes are a must try.', 5, timestamp '2020-03-13T19:36:07+0530', 39, 65),
(40, 'Recently visited this place and it was really a great visit. Environment is really healthy and positive. For me it was totally worth it. Staff was really nice. And services are appreciated. And food was very yum and tasty. Ordered: drums soya chilli Hot dragon chicken and honey chilli chicken. And along with them cold coffee. 5/5 to their food. mouth drooling! Highly recommend place!', 5, timestamp '2020-03-12T18:28:38+0530', 40, 65),
(41, 'Nice place. Kind of a vintage feel to it. Dal gosht was nice. Tandoori platter can be tried.', 3, timestamp '2020-03-09T17:59:25+0530', 41, 66),
(42, 'I had my eyes on this place since i was a child roaming the streets of Cannught Place. Finally visited last week. Experience was good. Food tasted average. Nothing to draw myself back. Staff is friendly thought. I liked paneer tikka more than chiken malai tikka. Butter Chicken was debated though - it is not as sweet as some people prefer.', 3, timestamp '2019-12-13T08:00:34+0530', 42, 66),
(43, 'We were shopping at connaught place and were looking to eat at a good place, we spotted embassy and entered. They have a seating capacity of close to 80-90 people on the ground n first floor. A well stocked bar too. We ordered paneer pakodas , masala papad , half butter chicken ,and a few tandoori rotis. Damages to the pocket - Rs 1528 ( US $ 21.4 ) inclusive of all taxes. Overall experience - Rs 650 we paid for half a portion of butter chicken was cut throat , just too expensive and the taste was nothing great. I would rate this place 3 on 5', 3, timestamp '2019-10-21T05:32:30+0530', 43, 66),
(44, 'I have gone with my family ,it wasa great experience and specially the famous daal makani daal I like so much and mushroom was the great ,nice presentation by the staff.', 4, timestamp '2020-03-16T00:54:34+0530', 44, 66),
(45, 'Visited the place for lunch with a friend. We ordered tandoori veg platter, the food was impressive. And the ambience was nice, vintage and fancy.', 4, timestamp '2020-02-16T22:00:50+0530', 45, 66),
(46, 'Cream of tomato soup. Here the beauty is the tomatoes are well well mixed which a wonderful taste of typical tomato soup with cream topping and bread crunch.', 5, timestamp '2020-01-18T21:00:42+0530', 46, 66),
(47, 'Great food and service loved the channa bhatora. Took my foreign clients and they had a great time. Thanks to Mr Pandey and Mr Deepak for giving us a great experience', 5, timestamp '2019-12-27T20:11:24+0530', 47, 66),
(48, 'I love all of its snacks: Big Samosa Large Bread pakora Veg. Hot dog Paneer patty And their mint sauce👌', 4, timestamp '2019-11-29T09:56:32+0530', 48, 66),
(49, 'Please donot waste your money by going to such restaurants. Even after replacing the first one the second one was terrible.', 1, timestamp '2019-11-28T18:22:05+0530', 49, 66),
(50, 'Great place ! lovely food ! Fine dining at Connaught Place . Lip smacking Indian food. We tried the masala papad, paneer pakoda, it was melting in the mouth .butter chicken was great but could have been boneless . Overall a great experience ! ', 4, timestamp '2019-10-13T12:01:09+0530', 50, 66),
(51, 'FAIYAN - The Chinese restaurant in Middle circle, Connaught Place!❤ . So i visited this place with my family on weekend and I really love the Chinese there. Basically, we were craving for Chinese cusine from very long time and at good location! So we found this one at CP and what could be better than Connaught Place. We had chop suey, fried rice, schezwan noodles and schezwan chilli paneer!🤤 It was a drooling experience for us and we came back home burping and my happy face!😌 Do visit and have some amazing chinese there!😍 We spent around 1200 rupees for 4 people!🤑', 5, timestamp '2020-02-11T20:46:15+0530', 51, 67),
(52, 'Small yet cosy. My favorite was their freshly brewed artisanal coffee. I went looking for something light but filling and got myself some talumein. I think the taste was on point. I wish I could take home their super beautiful crockeries.', 4, timestamp '2019-10-07T17:27:29+0530', 52, 67),
(53, 'Worst part was they don''t accept card payments. But cleared the same while placing the order. We ordered Hotn sour soup, pineapple rice and prawn on both the dishes main ingredients was missing (prawns and pineapple) was missing. It was such disaster to went this place. But ambience was good and relaxing. I suggest other place over this restaurant which is far better.', 3, timestamp '2020-03-02T23:03:38+0530', 53, 67),
(54, 'A very small and compact place but food is awesome , you can feel the freshness and aroma of the food very well , potato toastier, chilli garlic noodles , veg manchurian must try, the ice cream they serve is less sugary and simply great, a must visit', 5, timestamp '2020-02-14T13:53:17+0530', 54, 67),
(55, 'The food was tasty with authentic chinese flavours. The staff was courteous and the place was not to noisy, good for an quiet evening time . ', 5, timestamp '2019-10-16T00:33:13+0530', 55, 67),
(56, 'Thus is in strict sense a restaurant only , no interiors or things to look at . But wat they believe in is good food n service n m glad to have tried this . Had booked it b4 but I was d only customer , may b the navratre effect ! Talunein soup was really good , d best I ever had , especially for the thin noodles in it . admixed with gentle amount of assorted veggies . D best part is " spring rolls" , I would die for them . So good was the exterior coating , not too thick or thin n no oil coming out n smearing my hands ! Filled with cabbage onion mix , fried to just the optimum level. a must try . , do try the red sauce with it , we used it to garnish our other item tooo. Next up , in main course , American choupsey was nothing like I had in so many Chinese joints ! Liquid veggies tomato sauce came separately with the thin noodles . n u mix n eat , it was simply heaven . a go ahead any day . A hidden gem , but definitely needs to work upon the interiors n the wall paints n old serving glasses ! ', 4, timestamp '2019-09-30T22:30:35+0530', 56, 67),
(57, 'This spot has the best chinese nourishment in focal delhi. Yummy Chinese nourishment and spending cordial! The amount of nourishment per plate is additionally lovely good.We had Honey Chilly Potato, Hakka Noodle and more. All the nourishment was great and superb and they constantly dazzled me by their food.I love the nourishment here.', 5, timestamp '2019-09-29T23:11:29+0530', 57, 67),
(58, 'This place has the best chinese food in central delhi. I love their prawn noodles a lot. The quantity of food is also good. It is very cosy place with very less tables.I would recommend it to anyone looking to eat authentic chinese in a decent budget.', 5, timestamp '2019-08-26T15:01:35+0530', 58, 67),
(59, 'We went to this place for the first time yesterday for a rakhi dinner. My brother likes chinese food so we did a bit of research before going. The place is a bit small and yesterday being a holiday it was crowded so we had to wait a bit. But once we sat down it was a real treat which followed. We ordered crispy salt and pepper veggies, spring rolls and drums of heaven. Didn''t quite like the drums of heaven as it was a bit bland and very dry. The dishes were good. We also had pan fried noodles mixed and fa tuan special fried rice. Portions were great and the taste superb. Even after eating so much we didn''t feel stuffed. Food was light and tasty. What we liked most was the similarity in taste with Kolkata Chinese which we miss in Delhi. Service was prompt and efficient. Overall a good experience.', 5, timestamp '2019-08-16T20:03:03+0530', 59, 67),
(60, 'This place serves one of the best dim sums in delhi . Personally in love with their clear soups! Authentic alert! I amma go back their soon!', 5, timestamp '2019-06-14T22:45:01+0530', 60, 67),
(61, 'No chicken, only tofu', 1, timestamp '2020-01-08T21:36:35+0530', 61, 69),
(62, 'Excellent food and huge portions. I have decided to always order from Chungwa for home delivery. Very reasonable too. Thank you Chungwa team', 5, timestamp '2019-11-19T15:14:30+0530', 62, 69),
(63, 'Recently ordered in for 1 portion of chicken talumein soup, and 1 veg talumein. It tastes really nice, but I have had spicier talumein soup from it. Also I found salt to be a little less. :)', 4, timestamp '2019-10-19T10:17:51+0530', 63, 69),
(64, 'Very average food however service is brilliant! I mean too good. for some reason everything just taste same for some reason. I mean its just the same.', 3, timestamp '2019-10-01T15:45:49+0530', 64, 69),
(65, 'cherished the administration and the nourishment was filling. Their segments are extraordinary and I adored the inside. I would prescribe this spot to individuals those things who need to have extraordinary Chinese Food.we requested veg manchurian nippy garlic noodles and seared rice all there were astounding in taste and had a better than average look manchurian was fresh and delicate while noodles however crisp yet were of incredible taste and next singed rice were astonishing had an ideal taste and were cooked appropriately.', 4, timestamp '2019-09-27T13:34:10+0530', 65, 69),
(66, 'Legendary late DC Wong authentic Chinese recipes could be found only at two restaurants in delhi, one at chungwa and Fujiya restaurant at Malcha Marg, Chanakyapuri. I love you guys for being consistent in everything. Loves the foods being ordered. Thubten Khimsar, Malviya Nagar. ', 3, timestamp '2019-09-21T23:19:40+0530', 66, 69),
(67, 'I love the food. Food is great! However the service needs to improve. Incase you are still finishing your drink and done with your dinner the waiter might serve the bill and keep on reminding you to pay up. ', 3, timestamp '2019-09-21T23:06:55+0530', 67, 69),
(68, 'Poor service, no one to take order. Kept on requesting person to take order. Waited for 20 min only to order. Food was cold, got changed repeat was also cold. Iced tea was syrub. Received each items delayed. Had a very bad experience.', 1, timestamp '2019-09-01T23:09:00+0530', 68, 69),
(69, 'The staff was very bad and not cooperative at all. The chicken was smelling and they were just not ready to accept their mistake.i asked for the manager they were not making me talk to anyone. I can’t believe this type of service. So disappointed I would still expect a call back from the manager so I can actually explain what’s going on in this restaurant. ', 1, timestamp '2019-08-28T16:13:23+0530', 69, 69),
(70, 'Visited after long time only to be immensely disappointed! Tried veg wonton soup, chicken in black bean sauce with rice and vegetables in black bean sauce with rice (the meal). Everything was absolutely bland and no taste or texture whatsoever! The prices are relatively high as compared to nearby Asian/Chinese restaurants but the quality was so sad! Never visiting again . ', 2, timestamp '2019-08-27T02:21:24+0530', 70, 69),
(71, 'This is a yummy Chinese place where you can satisfy. I am totally love in with vibe of the place. They have some cute crockery and have courteous staff. Must try ︎Chilli chicken ︎hauka noodles ', 4, timestamp '2019-10-01T00:04:05+0530', 71, 73),
(72, 'Ichiban is an amazing option when it comes to having lip smacking Chinese and Thai food. This casual dining place serves Chinese, Japanese and Thai cuisine. Place is beautifully done and has warm vibes. Staff is warm and courteous. For appetizers,  I had  honey chilli potato which were crispy with sweet and spicy notes -it will definitely activate your tastebuds. Spring rolls were little oily but tasted good and it paired well with chilly garlic dip. Crispy tangy button mushrooms are definitely worth trying especially for funghi lovers. For main course, I had  Veg manchurian  which was tasty and manchurian balls were soft. Mushroom dimsums were the star dish here.  I would love to recommend it.Thumbs up! Momo lovers should definitely try. I ended my meal with darsan and date pancakes- both these desserts were out of the box and tasted heavenly. Ichiban will certainly hit the spot when you’re looking out for a Chinese meal. Follow my food journey on Instagram- teekhi_mircheee', 5, timestamp '2020-03-22T00:21:36+0530', 72, 73),
(73, 'A great place to have Chinese and Thai food. Easy on your pocket, the service is quick, the staff is courteous and the food is yummy. A must visit for authentic Chinese lovers.', 4, timestamp '2020-02-19T15:27:01+0530', 73, 73),
(74, 'The food is just beyond amazing loved the dumplings, chicken in hot garlic sauce and noodles. The service was on point 😍', 5, timestamp '2020-02-02T19:11:15+0530', 74, 73),
(75, 'Good food, good prices and big portion size. Ichiban has a big menu with something to everyone’s liking and I love the consistency of the food & service. Chilly garlic noodles are my favourite. Being a vegetarian, there are a ton of yummy choices to pick. Paneer satay, spinach and corn are good dishes too.', 5, timestamp '2020-01-17T13:26:58+0530', 75, 73),
(76, 'I love Chinese food with a touch of familiarity and I love the food at Ichiban for the same reason. I have been to this place with my family and we love the food. It’s a cozy restaurant and the food is the real star. The regular stuff like Chilly Chicken, Hakka Noodles, Pad Thai noodles are amazing without being too oily.', 5, timestamp '2020-01-17T08:51:23+0530', 76, 73),
(77, 'There’s something about age old places in Delhi that accentuate the flavours with delicious nostalgia. Ichiban is definitely one such restaurant serving kick ass Asian food, culminated with richness & quality. The menu is vast so it’s hard to pick favourites but I definitely have a few top picks: Chilly Lotus Stem Singapore Prawns Chilly Chicken Pad Thai Noodles They have started doing sushi too which is great. The rolls aren’t overly creamy and are made with fresh seafood. Price point is perfect too cuz portion size is humungous. Check these guys out if you already haven’t. Thank me later.', 5, timestamp '2020-01-16T21:59:39+0530', 77, 73),
(78, 'I use to regularly order soups from ichiban and believe me they are one of the best outlets to try soups from. The prices are okay but the portions are great , a bowl of soup is a meal in itself. Packaging can be improved upon and so is the preparation time.', 4, timestamp '2020-01-04T02:47:49+0530', 78, 73),
(79, 'Nice cozy place for Chinese food. Must have soup here. Quick service. Tasty food. Full filling quantity!', 4, timestamp '2019-11-23T18:14:04+0530', 30, 73),
(80, 'Amazing food, and their service is soo good I mean I usually don’t write reviews but this one deserved one. Its worth the money. Going to be a regular now.', 5, timestamp '2019-11-13T22:59:07+0530', 79, 73),
(81, 'I just loved the ambience and the ethnic south indian setting here. It just complements your meal completely. Food was good too. Their welcome drinks were good. Mysore masala dosa was again something very good. I would highly recommend it. We ordered panchtara uttapam which had 5 different kinds of uttapam most of them were good. Staff was very proffessional and courteous here.', 4, timestamp '2020-03-04T19:24:07+0530', 80, 89),
(82, 'Most authentic south Indian I have ever tasted 😋', 5, timestamp '2020-02-05T02:35:56+0530', 81, 89),
(83, 'Looking for authentic south indian food? This is what we have been missing until now. First experience at Naivedyam and it turned out to be an amazing one. Such courtesy of staff, servers and such a decent crowd. The restaurant takes you to another dimension. Oh the food! Authenticity at its best. Tip- request for gunpowder chutney.', 5, timestamp '2020-01-22T14:25:31+0530', 82, 89),
(84, 'Naivedyam over all 4/5 Best Food - Rasam, Paysam, Sambhar Food tongue tingler - Fried Chilli Ambience - 5/5 Loved the experience and warmth of restaurant special fried chilli is amazing. Paysam that was served with the naivedyam thali was amazing aswell. Will definitely visit again.', 4, timestamp '2019-12-29T19:38:11+0530', 83, 89),
(85, 'We were a group of 13 people and we went to this pure veg South Indian restaurant. We had ordered in bulk, Naivedyam thalis, Mysore masala dosa, paneer masala dosa, Tamarind rice and even Mysore pak. The food is sumptuous and quite filling. The ambience is also very typical South Indian with soothing Carnatic music playing in the background. All in all, this place is a must visit.', 5, timestamp '2019-12-24T00:00:49+0530', 84, 89),
(86, 'This restaurant has become my favourite place for South Indian food! Anyone who loves south Indian food, must visit here! The fast service, quality food, great taste, vintage ambiance & they way they served the food absolutely made me fall in love with this place! I would absolutely rate 10/10 to this place! Must try Mysore masala dosa & Rasam Papad here! Will absolutely recommend to my friends!', 5, timestamp '2019-11-11T21:26:12+0530', 85, 89),
(87, 'Looking for peninsular Indian dish you should visit this place. Even waiter are dressed in South Indian style and they are friendly in nature. Ordered paneer dosa and veg Thali. Both are good taste wise. One should visit if you crave for South Indian dishes', 4, timestamp '2019-11-08T00:56:25+0530', 86, 89),
(88, 'Naivedyam is a good place if you want to have typical south India cuisine. They have the authentic taste. All the food is majorly cooked in coconut oil. They do have a good variety in the menu. Really like their rasam papad and kesari bhaat. Didn''t quite like the uttapam and ragi dosa. Service was great! So overall experience - 3.5/5', 3, timestamp '2019-11-02T17:39:07+0530', 87, 89),
(89, 'Food was tasty , fresh.paid almost 300 for the thali - naivedyam thali. they forgot to give kosambari , when I asked about it the guy looked a bit irritated and got me 1tsp of salad in a katori. i feel for this price the food quantity is extremly less especially the rice.', 4, timestamp '2019-10-16T20:23:13+0530', 88, 89),
(90, 'Authentic South Indian flavour and dishes. Must visit. Very warm staff and soothing ambience.', 5, timestamp '2019-10-13T22:17:05+0530', 89, 89),
(91, 'This place is my first love, being a vegetarian it’s hard to find pure veg restaurants that serve food this tasty. It has been at this location since decades and have been maintaining the quality and taste of food without fail. It’s a perfect place for family dinners and is fairly priced as well. I personally love their kababs, paneer tikka, sahi ke kabab and tabdoori pineapple. All of these have a distinct flavour which stands out from other restaurants. Also, their veg thali is something that i order almost always. The dal makhni here is like no other, with perfect spices, consistency and flavour, it is something that you would come back here for, again and again. My mom likes to order masala chaap and paneer lababdaar which is outstanding too. Coming to dessert and drinks, don’t miss their lassi and fruit custard which is absolutely delicious.', 5, timestamp '2020-02-09T14:13:34+0530', 90, 103),
(92, 'I absolutely loved veg Gulati''s food it was so good everything was just perfect in taste. staff was so courteous :D had wonderful experience! Good place for vegetarians :D', 5, timestamp '2020-03-13T17:49:16+0530', 91, 103),
(93, 'Veg Gulati:- It was a marvellous experience Going to Veg Gulati restaurant situated in pandara road , ambience was very good there , staff was very courteous and service was very good. Now comes to major part , food that was very good there , especially Malai and Tandoori Chaap , so guys do have a visit to them and try their food.', 5, timestamp '2020-03-14T21:58:43+0530', 92, 103),
(94, 'Went to Veg Gulati with my family friends for a brunch and trust me this place is perfect for all kind of brunch and family dinner. Ambience here is very sober and decent. Talking about the staff, their service was great and on time. We ordered their dahi ke kebab, soyachaap and tandoori mashroom for starter''s. Soya chaap were extremely delicious and was very tender in taste. Tandoori mashroom is a highly recommended dish from Gulati- it was well prepared with lots of flavours. In main course we ordered Rajma chawal combo and Mahara thali. My personal favourite dish in main course was Rajma Chawal. In all we had an amazing time here 😊', 5, timestamp '2020-03-14T18:53:39+0530', 93, 103),
(95, 'If you are hard core vegetarian and want to have some delicious vegetarian food, then this is the must visit place. I recently visited this place with my friend and experience here was very amazing. I tried :- > Dahi ke kebab > Galouti kebab * Both were very delicious and has melt in mouth consistency. > I also tried their Maharaja thali - this thali has dal makhani, shahi paneer, diwani handi, rice, raita, dessert and one paratha. The dal makhani and shahi paneer were really delicious. Overall, I really loved this thali and one must should try this 👍 In desserts I had, gulab jamun and ksheeram. Both were supremely delicious 😍 Will definitely visit this place again for sure 👍', 5, timestamp '2020-03-05T22:53:53+0530', 94, 103),
(96, 'Now Pandara Road has a lot of restaurants but when it comes to vegetarian food, veg gulati stands the best in my eyes. I recently went there with a friend of mine and loved the place to bits. I started with a Tandoori platter and a kebab platter and both the platters are to die for. Grilled pineapple, mushrooms, dahi ke kebabs were the best out of both the platters. Further, they have a huge menu with lots of variety of main course dishes. I had Dal Makhani, Veg Biryani , Soya Rara and Palak Kofta and all of them were delicious. If you are coming here don''t forget to try their chaap/soya preparations because they are to die for. Palak Kofta is a must try from my side. You can end the meal with ksheeram which is made with carrot, bottle gaurd and almonds. To be honest, bottle gaurd might not sound too appetizing but this dessert was absolutely delicious. (Highly recommended!) I would definitely love to visit the place again for its awesome food. ♥️', 5, timestamp '2020-02-21T11:38:16+0530', 95, 103),
(97, 'Except for the food (which too was not great guns), nothing was anything better than GROSS. Their staff head came to take the order n guess what he din even know all the items in the platter. Their was a platter of 5 n I was literally counting 1, 2, 3, 4 n 5th? Guess what? He started thinking as if he had gone to Mars for 10 sec n said aisa hi hai kuch.🤣 2. It never occurred to him to repeat the order. 3. I asked for bottled water only to be left aghast as the waiter very conveniently forgot to bring the glasses(May be he expected us to drink right outta bottle) 4. There was a Zomato coupon which said 15% off, which the manager refused to give with no plausible reasons. 5. Basically it’s an overhyped place with everything Clichéd “A BIG NO NO”', 1, timestamp '2020-02-13T14:32:18+0530', 96, 103),
(98, 'One of the finest vegetarian places in India. Yes, truly authentic Punjabi food served piping hot with a broad smile and the portions are as large as that of a Punjabi''s heart. No exaggeration!. I was here in August 2019 a few days after Independence day with my family. Parking 4/5 Ambience 5/5 Food portion 5/5 Food Quality 5/5 Service 5+/5 Overall Rating 5/5 😇', 5, timestamp '2020-02-08T12:56:34+0530', 97, 103),
(99, 'I tried for the first time. For ordering food at home is really bad. Ordered paneer Tikka and amritsari kulcha. ', 2, timestamp '2019-12-31T22:18:39+0530', 98, 103),
(100, 'Having been to Gulati for their famous Non vegetarian dishes made me try their vegetarian edition also. We ordered Amritsari Kulcha, Dilbagh Kofta and plain roti. Kofta''s were not upto our taste as the gravy was nothing but tomato puree. The kulcha was good though.', 3, timestamp '2019-11-27T10:48:23+0530', 99, 103),
(101, 'One of the best chinese food in delhi ncr. Located in nfc and parking easily available. the food is very fresh and authentic. The prawns, soup, noodles etc everything is super delicious. I will visit this place once a month for sure', 5, timestamp '2020-01-17T17:14:45+0530', 100, 112),
(102, 'Lotus Pond located in NFC near Sarai julena is an amazing restaurant to have asian food from. We had their Butter Pepper Garlic Prawns , Drums of heaven with Beerita which was very good in taste. Shredded lamb with hot garlic Sauce and the Fried rice with Chicken was a nice maincourse to end the meal with. In Desserts their Honey Glazed noodles with vanila ice cream was the best one can have at this Amazing outlet.', 5, timestamp '2020-02-19T20:52:34+0530', 101, 112),
(103, 'Loved my experience of food here at Lotus Pond. Their food is always delectable pan asian food which is our favorite. Cottage Cheese in Basil Sauce was among our favorite appetizer along with water chestnuts in Butter Garlic Sauce. Their Crispy Corns with Spinach was also very good. And Corn and spinach Dimsums was also very good in taste. In main course veg chilli garlic noodles with Chinese green Vegetables was very good. In desserts their Moca Rage is absolutely Amazing to have.', 5, timestamp '2020-02-19T20:50:44+0530', 102, 112),
(104, 'Antique place for me. have been going there since ages and the food just keeps on getting better! Mr Thapa the manager is courteous and calls after each delivery to check for quality. awesome Chinese! Simple love the food here', 5, timestamp '2020-01-24T11:48:34+0530', 103, 112),
(105, 'Visited this beautiful and perfect place for chinese and asian food. they have such a great menu with lot of vatiety of food and beverages. i ordered:- Fried chicken:- 5/5 very soft and juicy Black pepper chicken dimsums:- enough stuffing and very tasty Spiced ginger honey fish :- absolutely amazing . loved iy All were great taste and nicely presented. Hot and fresh food served Loved it. Recommemded', 5, timestamp '2020-01-06T08:29:38+0530', 104, 112),
(106, 'Today i was in new friends colony and went to lotus pond nearby my place. Heard alot for its asian food. Ambience was amazing. So what we ordered were:- 1. Chicken chive dimsum 2. Chicken hakka noodles 3. Deep fried chicken Chicken dimsum were very soft and delicious. Chicken hakka noodles were also tasty. Deep fried chicken were scrumptious and light. Overall the food was good in taste.', 5, timestamp '2020-01-05T23:17:30+0530', 105, 112),
(107, 'I found a Gem in New Friends Colony 😍 Lotus pond is such a great place to enjoy some amazing Food. I love Asian Cuisine and this place is just perfect for my cravings. They have a great ambiance with a very good staff. I tried their Chicken Dimsums which were wonderful. The Thukpa was really good too. You can definitely give Lotus Pond a try. You''ll love the place.', 5, timestamp '2020-01-05T23:06:52+0530', 106, 112),
(108, 'Recently tried lotus pond. Nice place to have food with family and friends. Ambience was good with nice decor. Ordered chicken hong kong and chilly garlic noodles. Chicken hong kong was delicious. Noodles were nicely cooked with nice blend of flavours. Service was also good. Overall nice experience.', 5, timestamp '2020-01-05T23:04:17+0530', 107, 112),
(109, 'If you’re not on budget, then this is the place you must think of! I went here with ky family and it was quite a good experience! We ordered: Chicken nasi goreng meal Chicken pan asian paella meal I quite liked the chicken nasi goreng meal! Would highly recommend it! Staff was quite polite as well!', 5, timestamp '2019-12-29T18:52:56+0530', 108, 112),
(110, 'Lotus pond is located in new friends colony and its the best place to have food with your family and friends you will love the ambience the quality and the quantity of the food you will love the taste and it is famous for sea food , asian food you will love it because they give you fresh food the taste is good and the service is also very nice you will feel realxed must try this outlet', 5, timestamp '2019-12-26T15:25:22+0530', 109, 112),
(111, 'The place is legendary . The food was excellent . The best Indian food I’ve had in recent times , no wonder was used to my parents fav list . Service was also very nice . Kwality is famous for there chole bhature and they have kept standard very up in that. Chicken snacks main coarse was amazing . Surely going back', 5, timestamp '2020-03-18T23:06:07+0530', 110, 121),
(112, 'I loved their catering service. The prawn hargow dimsums were a mandate. The ebi tempura sushi is a must have and so was the edamame dimsums. The food on the whole was par excellence. I thought this place had lost it’s charm, due to many prior incidents. But I was truly in love this time. Keep up the great work', 4, timestamp '2020-02-24T17:35:18+0530', 111, 121),
(113, 'I visited Kwality restaurant on a busy Sunday afternoon and we decided to order their famous Chana bhatura along with Kwality Chicken kabab and Paneer Boti Tikka. The food was amazing and I loved everything but the Paneer Boti Tikka was exceptional and surely one of the best paneer appetisers I have ever had. It a must try. They also have a fully stocked bar and I would really recommend their drinks as they were really good. The staff is also very polite and our server Shanky was really helpful. Kwality is a legendary restaurant and should be on your list if you are looking for some good North Indian or Continental food with classy ambience.', 5, timestamp '2019-09-30T09:51:11+0530', 112, 121),
(114, 'If you are in for a royal retreat then Kwality Restaurant is the place to be in. The interiors speak aloud the royalty and elegancy of this place. Talking about the food it is a cherry on the cake, right from appetizers to main course to desserts this place is just perfect. Must Haves- Chane Bhature, Chicken Bharta, Minestrone Soup ', 4, timestamp '2019-09-29T21:54:06+0530', 113, 121),
(115, 'We ordered a mix of Indian vegetarian and European non-vegetarian dishes. Everything surpassed our expectations. chole Bahture, Chicken Ala Kiev, Chicken Steak, Lamb Chops, Tomato fish all outstanding. Excellent service by Shanky.', 4, timestamp '2019-09-29T04:21:57+0530', 114, 121),
(116, 'Authentic butter chicken, old style black dal. Style and a great feeling. Breads cooked right. Makes you go Dilbar Dilbar. Service by Dilbar excellent, an informed man with a smile and soft demeanor leading you to culinary and gastronomic delight with a smile. Ask for him and dishes above', 5, timestamp '2020-03-04T22:37:16+0530', 115, 121),
(117, 'Visited Kwality for the first time after the makeover and I’m head over heels in love with this iconic restaurant. What I loved about this place is though it has a new decor but still it retains the old-world charm. And it still serves the bhathuras as big as your face! This is undoubtedly one of the best places in Delhi for dose of delicious chole bhature. The flavors are bang on, and they have been serving this city for the last 80 years. So they don’t just deliver taste but also nostalgia.', 4, timestamp '2020-02-10T10:35:47+0530', 116, 121),
(118, 'Service was very gud. server named Atul was very polite nd friendly. Ambience was great. Only thing the quality of fud is not upto the mark. ', 5, timestamp '2020-02-02T15:36:07+0530', 117, 121),
(119, 'Yesterday I spend my time with family here. So I ordered shahi paneer khardhi paneer paneer tikka Dal makhni butter naan. This taste so good and it''s worth of money and I like to spend my weekend here', 5, timestamp '2020-01-30T18:35:01+0530', 118, 121),
(120, 'Excellent food! Brilliant service, special appreciation for Mr. Puran and Mr. Atul! Great job done by both of them, flawless service! Keep it up!', 5, timestamp '2020-01-27T23:19:49+0530', 119, 121),
(121, 'I used to visit MINAR since my childhood days with my family. The place is extremely well maintained and food is amazingly delicious. This time I ordered my favourite butter chicken and kadai paneer. Butter chicken was perfectly cooked, super tasty, very soft and flavorful. Kadai paneer was delicious and gravy had a good balance of spices. Over a very perfect place for hang out with friends and family. Highly recommended. !', 5, timestamp '2019-12-10T08:22:42+0530', 120, 125),
(122, 'Having heard much about this restaurant, I finally got to taste their food. I have to say the place has a warm and family kind of touch to it. As soon as you step inside, you get the vibe of a vintage place. Coming to the food, I absolutely loved their preparation of even the simplest of delecacies; the aroma of whole spices and ancient recipes can be felt in the first bite itself. The quantity too is pretty generous. Overall, a good experience .', 4, timestamp '2020-03-05T21:27:58+0530', 121, 125),
(123, 'Worst food and total waste of money. We ordered daal makhani, kadai paneer, malai kofta rice but all food is stale and no taste. Dhaba food is much better than there. Big disappointed', 1, timestamp '2020-03-04T14:54:24+0530', 122, 125),
(124, 'Padam singh Rawat super server ा आ ा ई ल द ी maintain', 4, timestamp '2020-02-26T23:44:23+0530', 123, 125),
(125, 'Very bad experience. had heard a lot about their butter chicken - was a big let down. Chicken was watery. would not recommend.', 1, timestamp '2020-02-08T20:59:28+0530', 124, 125),
(126, 'Visited there with family to utter disappointment. Food was distasteful and lacked presentation. Whole meal was just a sad affair. Overheard an issue on the next table about finding a bone in a vegetarian item. Couldn''t eat rest of the meal post that incident. Ambience definitely needs a re-do. Service was okay.', 2, timestamp '2020-01-16T22:01:33+0530', 125, 125),
(127, 'This place is great, I like the food here and the atmosphere, it''s not a fancy resturant but the food is great and the price is perfect. A good place to go out with family', 4, timestamp '2020-01-16T20:49:10+0530', 126, 125),
(128, 'First the restaurant was too compact and overcrowded. The tables were of very small size. Utensils were of low to poor quality and weren''t cleaned either. Paneer makhani tasted sour and plain naan was was not fully cooked and stale(exaggeration). Instead of giving tissues they gave towels which is not at all hygienic. Service was moderate to low. Not everyone was in uniform. No standard and hygiene was maintained which is the least expected from a decent restaurant. The vibe was more of a dhaaba.', 1, timestamp '2019-12-26T22:37:00+0530', 127, 125),
(129, 'Mutton sheikh kebab. Here the secret is the mutton well mixed  and fried which gives a wonderful taste. Well served with green chutney nd onions.', 5, timestamp '2019-09-21T22:19:47+0530', 46, 125),
(130, 'Happening place, sound and pleasant ambience. Crowded atmosphere speaks itself for food and quality offered. Serves 🍺 Good choice to hang out with your friends and family. ', 4, timestamp '2019-09-19T21:25:06+0530', 128, 125),
(131, 'This place is pathetic Food was tasteless Service was bad Rates are super high for no reason Not worth it They need to clean the place as wel', 1, timestamp '2020-02-03T09:59:39+0530', 129, 132),
(132, 'WE ORDERED FOOD YESTERDAY ,THE FOOD WAS DISGUSTING ,VERY BAD ,TASTELESS . WE ORDERED BUTTER CHICKEN, DAL AND NAAN BUTTER CHICKEN WAS TASTELESS THE GRAVY WAS ONLY TOMATO WITH NO MASALA AND CREAM  DAL WAS WATERY ,NAAN WERE UNCOOKED WHAT THE HELL IS MOTI MAHAL DOING ,THEY ARE SERVING HOPELESS TASTELESS DISGUSTING FOOD TO ITS CUSTOMER AND GOING EXPENSIVE DAY BY DAY THE MANAGEMENT SHOULD RESPONSE ASAP', 1, timestamp '2019-12-05T14:27:56+0530', 130, 132),
(133, 'I am feed up of your forced review. Will you enable me to otder', 4, timestamp '2019-10-26T20:40:55+0530', 131, 132),
(134, 'A family dinner at Moti Mahal was so good, we got some veg and some non veg dishes and both were tasty and filling. Each dishes were nicely flavored. Nice ambiance and well decorated.  Very neat and clean ambiance. Good customer service and very quick staff.', 4, timestamp '2019-10-07T08:34:47+0530', 132, 132),
(135, 'The food was absolutely horrible be it the starter or main course. We ordered one each with a dessert and were charged Rs. 4000 for shitty food! Avoid! ', 1, timestamp '2019-09-27T00:56:23+0530', 133, 132),
(136, 'After spending almost 3000 on food, one would expect it to taste, there was no taste in the food, it was bland, the curry was full of water The world famous dal makhni was runny Everything was awful They need to revise how they serve such pathetic food at such exorbant prices As per the experience, we had to literally pack 70% of the food and hopefully make it better at home and then feed the homeless', 1, timestamp '2019-09-14T20:37:44+0530', 134, 132),
(137, 'It is the best Indian restaurant. The most authentic and delicious Indian food ever', 5, timestamp '2019-09-07T19:54:50+0530', 135, 132),
(138, 'If you are craving for some delicious North Indian & Mughlai food then this is the perfect place to visit.For the starters we ordered :Orderd chilli potatohakka noodlestandoori plattermurg tikka .  Coming to the main course we had :mutton rogan joshdal makhni paneer lababdaregg curry with their special big naan and which was very delicious. Nothing Can Beat There Delicacy And Taste', 4, timestamp '2019-08-31T15:36:41+0530', 136, 132),
(139, 'Ordered Butter Chicken - always a classic - and was not disappointed. The prices are on the higher side but it tasted great and was seasoned appropriately. The delivery was prompt as well. ', 4, timestamp '2019-07-27T23:59:16+0530', 137, 132),
(140, 'The ultimate butter chicken ever ! Chicken tikka is not to be missed . 30 years - never been disappointed . The staff is friendly and mostly accommodating ', 5, timestamp '2019-07-14T21:18:14+0530', 138, 132),
(141, 'Such a worst and bad quality food. No presentation no taste no ambience . Avoid it', 1, timestamp '2020-03-12T00:43:46+0530', 139, 134),
(142, 'Moti Mahal is supposed to be well known for the North Indian cuisine. Visited on wed afternoon with friends was quite disappointed with the ambience as it has few cramped tables and section on 1st floor is blocked as it’s closed since ages. The food was a let down too as they served burnt dal makhni which is their signature dish. The butter chicken was boiled and undercooked chicken in gravy. They offered to change the food but since it was served a bit late we didn’t have time.', 2, timestamp '2020-02-27T07:19:22+0530', 140, 134),
(143, 'On a lazy Sunday evening, my friend and I decided to try this place. The place is super cramped since their dining on the top has been sealed. You can overhear the conversations from the next table 🤷 We order naan, butter chicken and chef suggested special non veg pulav. The butter chicken was itself disappointing. Tasted more like a tomato soup with chicken in it. The chicken wasn''t juicy and/ or tender. Tasted very bland. The special pulav was a mix of chicken, mutton and egg. This was ever more disappointing than butter chicken. There was hardly any meat chunks in it. It didn''t deliver well even on taste. Their service is slow despite having low customer demand-supply. Wouldn''t recommend! It''s D for Disappointment!', 2, timestamp '2020-02-20T21:26:02+0530', 141, 134),
(144, 'Prices are a bit high as compared to the quantity served. However, the taste of the dishes compensate for it and it’s beautiful ambience mad', 4, timestamp '2019-12-05T22:21:19+0530', 142, 134),
(145, 'Stale rice served, not only could we tell from the taste, but fortunately/unfortunately when they left the kitchen door open, i saw them heating a bowl of plane boiled rice in the microwave. Let''s not even talk about how they tasted. Never going back again!', 2, timestamp '2019-12-03T09:18:53+0530', 143, 134),
(146, 'Mr Jai pal Singh . Moti mahal south extension Very hospitable to his customers . we are very happy with his service . will surely recommend', 5, timestamp '2019-12-01T20:37:43+0530', 144, 134),
(147, 'Seems to be a paradise for non vegetarians, unfortunately we were vegetarians so does not like it much. Pindi Chole was flop show for us. ️ Although aachari Paneerr and Pudhina Lachha was a saviour 😋', 3, timestamp '2019-11-27T23:07:23+0530', 145, 134),
(148, 'A very small joint in Defence Colony but the food and service is good, tight seating space but overall it’s a decent experience', 5, timestamp '2019-08-19T08:49:59+0530', 146, 134),
(149, 'The food is superb and the presentation is also good. Ambeince is fine not so good as compared to other restaurants in defence colony. Must try the mutton and chicken tikka. The staff needs to be a little polite. ', 4, timestamp '2019-08-18T12:53:08+0530', 147, 134),
(150, 'The Tandoori chicken and the butter chicken are generally pretty good. The naans and the Rotis can be better. The makhani Dal also is pretty good', 5, timestamp '2019-08-11T13:44:53+0530', 148, 134),
(151, 'Golden dragon is a decent place. The food is good in taste and less spicy which I like the most. I ordered Mixed Meat Rice and Alibaba mocktail. Quite decent in taste. Average pricing and great Ambience. Also, later I ordered some noodles at my place.', 3, timestamp '2020-03-11T13:11:39+0530', 149, 141),
(152, 'Hopeless services, attitude of staff and managers. They are busy at payment counter in gossiping, on mobiles. Yesterday i went with my family and ordered snacks and told them to get . After 5 minutes i ordered main course. till 35 minutes nothing was served as staff was just gossiping and only 6 more guest were in whole restaurant, i asked about snacks, staff (tall fair slim guy) who had taken order for snacks just smiled and said " 2 minutes" but till 10 more minutes nothing came, then a lady staff who had taken main course order brought main course, i asked about snacks, she was clueless, then i told them to serve snacks first and bring fresh main course later, to my surprise she kept main course in microwave oven, then i called Manager and explained that, till another 8 minutes nothing happened. after dinner when i checked the bill i found one fish dish whereas we had ordered sliced chicken with lemon sauce, instead they served fish. when i told about this to manager at counter, his response was clueless and casual, instead staff at counter was rude and wanted to pay me as per bill and first he refused to give correct bill. i asked manager about Mr. Rohit Bagga''s nos. which was denied, Mr. Rohit if you are reading this , write to me on nareshmeht@gmail.com Lot more to tell you,', 1, timestamp '2019-10-17T12:26:52+0530', 150, 141),
(153, 'I dont understand the point of charging a service charge when there is no basic service. Extremely overpriced food that isnt a bit interesting. All this when the restaurant had fewer than 4 customers. Will never recommend as this is a over-rated place. Bad tasting food and bad service sums it up. ', 1, timestamp '2019-10-02T16:55:34+0530', 151, 141),
(154, 'Taste - 2/5 Service - 4/5 Ambience - 3/5 Hygiene - 3/5', 3, timestamp '2019-09-02T00:55:48+0530', 152, 141),
(155, 'Must Go for Chinese Food,Noodles, fried rice, Soup. Zomato Gold ia available here. Varieties of Drinks available. Nearest Metro is Vinobhapuri on pink line metro ', 5, timestamp '2019-09-01T18:54:38+0530', 153, 141),
(156, 'So sometime back, i was in a mood to have duck and came across Golden Dragon''s menu, so i was a little excited to try a new place and some new dishes, i called up the restaurant and asked if the duck was available, they said that it is, so i was on my way ! As we went to the place it looked good, and something to look forward too, as expected i ordered the duck and to my surprise the waiter said that it was not available, i told them that i asked in advance and then only came to the place, so the manager intervened and said that the duck had turned bad as it was a little old and it may not taste good, so that''s why we aren''t serving it, a little odd it was and no doubt my expectations came crashing down, but still i was hungry so decided to give other dishes a try. I had: Crispy chilli lamb: Shredded lamb cooked with onions and capsicum, this one was a disappointment the lamb was very dry and lavked any kind of flavour, it was just spocy, nothing else, nothing more, not a good one. Basil chilli crab: A chilli crab dish that looked good on the menu, but very bad on the plate, it was just a disaster of the dish, that it looked so bad on the plate too, the crab too was overcooked that meat felt like a chewing gum, no flavour. The dishes were disappointing, taste so bad, presentation totally dead and the duck incident just strange, no words.', 1, timestamp '2019-08-17T22:37:51+0530', 154, 141),
(157, 'Since 5 years I have been going to this place to have Chinese food, very good service, atmosphere is also good, the food quality and quantity is sufficient, overall excellent. ', 5, timestamp '2019-07-25T21:45:47+0530', 155, 141),
(158, 'This place is walking distance from my place and one of the best restaurants offering Chinese cuisine. Ambience is amazing. The signature dish Manchurian is the best. ', 5, timestamp '2019-06-02T23:28:36+0530', 156, 141),
(159, 'Horrible food and that too at a very good rate 😂 Please don''t go and waste your time and money Ambience is okayish 😅 Dont go Don''t go Don''t go', 1, timestamp '2019-06-01T15:47:13+0530', 157, 141),
(160, 'We been there yesterday, waiter took tym to visit on table as few items were missinf from the menu, so tried chilli chicken, chicken honey and mex veg with hot garlic, i found honey chicken was abit more sweet then it suppose to be, chilli chicken was average, over all average in everthing. ', 3, timestamp '2019-04-08T15:39:24+0530', 158, 141),
(161, 'Always on top when we think about pizza we only think about dominos best option to have with many varities we had farm house pizza loads of cheese. Super crust withbloaded of veggies and paneer and with that my all time must have to order is stuffed garlic bread & choco lava 😍', 5, timestamp '2020-03-13T00:03:51+0530', 159, 143),
(162, 'Dominos is one of the best restaurant for pizza in my list And they serve amazing pizza and its not too expensive as compared to other brands in the market. And what to say about garlic bread, its my all time favourite My personal favorite pizza at Domino''s is Farmhouse (pizza loaded with lots of veggies) Mexican Green Wave(best for spicy ) And one can not ignore their sides . I love their Garlic Bread sticks with cheesy dip a lot. Its damn tasty, all time favourite. And their taco''s and chocolave are also soo delicious 🤤', 5, timestamp '2019-12-21T18:22:55+0530', 160, 143),
(163, 'A very good outlet of dominos that is located in CP. Usually very crowded at lunch time. Staff is very courteous, but you may have to wait for your chance to get a seat. What i liked here -Fresh food -seating area is good if you get a nice seat. -pizza is supremely loaded with toppings and cheese. -garlic bread was delicious.', 4, timestamp '2019-11-30T22:18:13+0530', 161, 143),
(164, 'I am huge Fan of domino''s pizza They dont need to review. All people know what they served for customers. Best taste. lot of variety in pizza etc. Value of money. Fastest delivery. ', 5, timestamp '2019-10-09T15:21:43+0530', 162, 143),
(165, 'st love it serves excellent pizza which no one can replace also Mexican taco which is also yummy. ', 3, timestamp '2020-03-23T19:18:05+0530', 163, 143),
(166, 'Amazing pizzas and great price too. I have eaten pizzas from pizza mania and garlic bread with cheesy dip. All of these are great. Staff is friendly and nice. There is enough space to hangout with friends. And they serve pizzas quickly too.', 5, timestamp '2020-03-15T19:29:36+0530', 164, 143),
(167, 'The pizza are really yummy with good quality of cheese . Love the pizza', 5, timestamp '2020-03-07T11:03:07+0530', 165, 143),
(168, 'Fab outlet to try out best pizza. The surrounding is beautiful, enough space available for people to dine in, quick service both for dine in or takeaway. Clean place and aroma of the place is amazing.', 5, timestamp '2020-02-27T16:23:56+0530', 166, 143),
(169, 'Domino’s is my favorite destination. Not only pizza but also other stuffs are good in taste. I always go for their meals which comprise of Pepper Barbeque Pizza, GARLIC bread and Pepsi. It is sufficient for two people and is economical too.', 4, timestamp '2020-02-24T16:47:22+0530', 167, 143),
(170, 'A worthy place for friends and family. The taste of food is so delicious. staff is very kind and well trained. they have launched 4 new flavours. those are ossum and filled with cheese . and smokey in taste', 5, timestamp '2020-02-19T21:56:38+0530', 168, 143),
(171, 'Don''t order from this subway pathetic service and sent eaten sub', 1, timestamp '2020-03-18T23:18:52+0530', 169, 147),
(172, 'Little expensive but the food was very healthy you can choose according to your choice everything especially the breads. Courteous and friendly staff with prompt service. Must try!', 4, timestamp '2020-03-04T19:42:52+0530', 170, 147),
(173, 'The Subways can be categorised as very a healthy Junk food option. Probably the only one in the world . The Veg and Non-Veg variety options are equally smashing . It offers you a whole lotta options from distinct breads to Sauces . Add to that the salads are amazing too. Bring it on . ', 5, timestamp '2020-03-04T16:13:51+0530', 171, 147),
(174, 'Being a vegetarian often I gets to eat aloo or paneer stuffing in veg options. But Subways got many interesting options. Their Chatpata Chana Sub and VEG Shammi is among my favourite. I enjoy their food for being prepared fresh and with finest quality.', 4, timestamp '2020-03-01T00:43:29+0530', 172, 147),
(175, 'I am loving it ! Yeah', 5, timestamp '2020-01-26T09:41:36+0530', 173, 147),
(176, 'Wow very niceeee it''s lovely', 5, timestamp '2020-01-25T12:59:31+0530', 174, 147),
(177, 'Pathetic quality of food; very little vegetables and sauces being put in the sub . ! My worst subway experience!', 1, timestamp '2020-01-16T23:49:51+0530', 175, 147),
(178, 'This the 2-3rd time that i have recieved incomplete order from your outlet and all the times it’s the beverage and chips If you can’t send the complete order plz mention it before hand or else don’t put it on your page that these items are available and later we don’t recieve them', 1, timestamp '2020-01-16T19:37:12+0530', 176, 147),
(179, 'the food was so good so tempting i never ate things like this i became a fan of this outlet all stars 5 out of 5 hygine 5 food 5 ambiance 5 service 5', 5, timestamp '2019-12-31T13:52:09+0530', 177, 147),
(180, 'The location of this outlet sucks and for those who don''t know the way around in the market it is a hard one to find. They almost never have all the breads available as if the staff is too lazy to bake a variety of breads and just keep on making the Italian bread. The salad is mostly not fresh, specially the onions and tomatoes. They crib when we ask them to put more than 3 sauces. I mean if I am ordering a foot long with and paying extra for double meat filling I deserve to put as many sauces I want. This outlet is not recommended at all', 3, timestamp '2019-12-02T11:18:34+0530', 178, 147),
(181, 'I had ordered for my beverages along with my food Only food came and no beverage. When i called them, they said write a complaint. You’d get a refund and then order again. No empathy towards the customers.', 1, timestamp '2020-02-13T16:04:03+0530', 179, 148),
(182, 'I order sub with chocolate truffle but they didn’t deliver my chor late truffle and I paid amount with my card', 1, timestamp '2019-10-17T15:08:37+0530', 180, 148),
(183, 'This is a very small place, filled with may be 5-6 staff, but to my surprise only two staff are preparing subs and wraps, rest are resting whereas people are in Que', 1, timestamp '2019-10-06T18:50:56+0530', 181, 148),
(184, 'Not upto the mark is what I''ve got to say about this place. The other outlets of this chain are really good , but sadly this place does not make the cut . The ingredients are stale, the tomato slices in the salad s were actually rotten and so bad that I had to spit it out . And when I went back to complain the servers were totally unconcerned and apathetic. Really terrible experience. ', 2, timestamp '2019-09-18T23:35:44+0530', 182, 148),
(185, 'Worst wrap I ever had though I always have the same wrap from a different outlet but this one was really stale and the wrap was really hard to eat ', 1, timestamp '2019-08-22T13:17:57+0530', 183, 148),
(186, 'Specially asked the subs to be toasted , like always subway delivery always somehow sends non toasted ! Really Disappointing', 1, timestamp '2019-08-18T22:24:01+0530', 184, 148),
(187, 'I order from Subway all the time and this has to be the most disappointing Sub I’ve had in a long time. No taste and no filling. Will stay away from this one. ', 1, timestamp '2019-08-14T11:11:59+0530', 185, 148),
(188, 'ALWAYS upto the mark. Meets expectation. Easy sitting and parking available. Salad is all time favourite here. Big Time favourite - Aloo Patty Sub & Veggie Patty ', 5, timestamp '2019-07-30T15:57:29+0530', 186, 148),
(189, 'The salads and the foot long was very very good, the most important thing was that it''s was very fresh and crispy, second thing is that the salads were packed in a very well organized manner', 5, timestamp '2019-07-24T21:35:10+0530', 187, 148),
(190, 'A perfect thing to order whenever someone wishes to eat healthy. I ordered chicken tikka sub and roasted chicken salad. All the vegetables and chicken were fresh.  Although I find it a bit costly.  So it will rate it 4 star', 4, timestamp '2019-05-23T22:30:19+0530', 188, 148),
(191, 'The place is small but quality is fine. Had been here alot of times Favourite is paneer tikka sub with southwest chipotle,mint mayo,tandoori and mayo on a parmesan oregano bread All time favourite', 4, timestamp '2019-11-13T21:09:33+0530', 189, 149),
(192, 'Ordered a subway recently. was very hAppy with the way they made it. The sauces put were a lot and the veggies too. From a chain like this we expect the best and healthy meals I have a really good experience the last time I ordered.', 4, timestamp '2020-03-04T16:48:55+0530', 190, 149),
(193, 'I enjoy subways to the core for serving healthy food. This place is particularly my favorite as it''s always serving fresh. Often big names after getting popular brands compromises with food but I believe Subways always serves the finest food be it wrap, Subs and salads etc.', 4, timestamp '2020-03-01T00:45:59+0530', 172, 149),
(194, 'Though the sub made was really nice, the staff attitude is pathetic, cleanliness is worst than a dhaba, the koftas were put in the microwave plate without a bowl, out of breads, out of tosties because they were out of cheese. It would have been all good if they were courteous or polite atleast or focused on doing there job, rather than talking about their personal lives out loud. @Subway needs to check this franchise !', 1, timestamp '2020-02-08T17:29:07+0530', 191, 149),
(195, 'I ordered Aloo Patty one A. Bread wasn''t fresh B. It tasted good initially, but i realised stuff inside it seem spoiled.', 3, timestamp '2020-01-05T18:55:15+0530', 192, 149),
(196, 'the food was so good so tempting i never ate things like this i became a fan of this outlet all stars 5 out of 5 hygine 5 food 5 ambiance 5 service 5', 5, timestamp '2019-12-31T13:55:27+0530', 177, 149),
(197, 'ordered toasted and got without toasting, barely any veggies and wrong sauces', 1, timestamp '2019-12-03T20:16:02+0530', 193, 149),
(198, 'We went there yesterday and had one roasted chicken sub and paneer tikka salad. And it costs us around 400 above. Taste was good. But they should enhance the quantity of paneer in their salad and lower down their prices. Over all it was a fine experience.', 3, timestamp '2019-06-23T20:01:45+0530', 194, 149),
(199, 'It was an amazing experience. The veggies were very fresh and the sub was made to perfection. The staff was friendly too! Overall I was fully satisfied and would love to come back again!', 5, timestamp '2019-06-18T14:51:22+0530', 195, 149),
(200, 'Been to many outlets of subway but this one by far is my favorite. The vegetables and the breads are always fresh and the the overall food never disappoints. Great experience!', 5, timestamp '2019-06-18T13:15:12+0530', 196, 149),
(201, 'I went to this restaurant with one of my friend then we order a sub of the day sandwich fir us i ordered a nonveg and my friend ordered a veg sandwich. The taste was good and it was healthy also.', 5, timestamp '2020-02-29T14:14:26+0530', 197, 154),
(202, 'if you are super hungery like me . so i tried subway''s rosted chicken and chicken tandoori 🍖 and it was amazing. Simply Loved it yummy!', 4, timestamp '2020-02-15T11:54:23+0530', 198, 154),
(203, 'Subway could easily pass off as the national health food chain. I like their veggie delite and aloo patty sub. They both taste good and are quite filling.', 4, timestamp '2020-02-07T11:10:48+0530', 199, 154),
(204, 'Double chunk cookies are the best', 5, timestamp '2020-01-28T14:09:07+0530', 200, 154),
(205, 'Nice subs in the city , thier quality and touch of olives is the best and we can feel the smell of fresh ness in all items .even bread smell like something cool so must try at all times.', 5, timestamp '2019-12-02T13:15:35+0530', 201, 154),
(206, 'Standard subway food. I did find my bread to be a little stale which was not very nice . But that was prabably a bad day since the next time i visited. The food was great. subway aa always. Absolute value for money', 3, timestamp '2019-09-06T14:00:23+0530', 202, 154),
(207, 'Located in Khan market , so whenever you are there and want some instant food subway is your destination. I went there for my shopping and was really hungry and wanted something to eat so went their and had my usual turkey subway , the staffs were really good and attentive.', 4, timestamp '2019-08-31T23:24:30+0530', 203, 154),
(208, 'Subway is the best way to have a quick and filling meal. The options are multiple and we tried our favorite Tuna here with oregano bread and all the way sub, Only leaving cucumber. The taste was amazing as usual and the veggies were filled generously. The staff is cordial and helpful. ', 4, timestamp '2019-07-22T14:37:32+0530', 204, 154),
(209, 'Whenever I order from Subway I always order the breakfast subs. The Egg and Cheese Sub and the Chicken Ham Egg and Cheese. parmesan and oregano bread toasted with mozzarella. I love it', 5, timestamp '2019-07-12T14:17:26+0530', 205, 154),
(210, 'Yesterday i ordered sub by some food app and it was routed to this outlet! I ordered veg shammi sub and the bread quality was too bad ! Not at all fresh and it was breaking when i took a bite ! Also the patty inside was too dry and taste was very bad ! It looks i am having something stale ! Freshness was not there ! Very bad experience! I wanted to eat something healthy and it turned up a pathetic experience! Even after 1 hour of delivery Food was not at all good ! Pictures itself say bread was too brittle ! ', 1, timestamp '2019-06-07T12:03:18+0530', 206, 154),
(211, 'Visited Snow''ora today just for their bingsu and tried their fruit and custard bingsu. Absolutely loved it, such a delicious dessert and the fruits went so well with the sweet shaved ice. Definitely recommend this one and the place is very nice and clean! Bingsu: 4.5/5 Service: self service Ambience: 4/5 Value for money: 4/5', 4, timestamp '2020-01-31T19:24:09+0530', 207, 19003045),
(212, 'Really unfortunate to have such bad food. Wish it lived upto the hype. 0/10. Never repeat mistakes. Pease', 1, timestamp '2020-03-07T00:46:09+0530', 208, 19003045),
(213, 'Very random place I visited. Tried this place and ordered Mango Mia from here . It tasted too good .💯', 4, timestamp '2020-03-01T19:23:25+0530', 209, 19003045),
(214, 'Decent ambience and pricing. They tried getting something new which was a good attempt but tastes wise it was average. You can visit here just to experience it for once.', 4, timestamp '2019-08-11T22:30:45+0530', 210, 19003045),
(215, 'Such good ambiance and flavours that are unique. Well priced and very clean. If you are tired of the usual gelators and ice creams. Snow is what you are missing. Light and flavorful', 5, timestamp '2019-07-28T15:11:45+0530', 211, 19003045),
(216, 'The ambience of this place was okayish. There were a lot of flies all over the place. I had ordered a litchee bingsu which was tasty and a Nutella waffle which had a fly stuck on it during the serve. So had to ask them to replace with another one. Staff is friendly.', 2, timestamp '2019-07-04T10:40:45+0530', 212, 19003045),
(217, 'This is a very different place which serves the traditional korean icecream. It has snow flakes served with a syrup, cream and topped with fruits, chocolate brownies and nuts. An amazing experience eating snowflakes and cream with fruits. I personally did not like the chocolate version. But both the mixed fruit and mango versions and very tasty. A bit pricy compared to the quantity. Ambience is quiet and cozy. Service is fast and good for families and friends. ', 4, timestamp '2019-06-04T16:16:10+0530', 213, 19003045),
(218, 'Went to this outlet today located in the busy streets of Pulkeshi Nagar . this place has a nice ambience except for the constant population of flies that flock the place . they are everywhere . on the seat . on the table. on the serving platform . they are everywhere . the staff is not what you would call friendly . the manager at the place said that one particular item was overpriced because the fruit is expensive. this was not even on the menu and he suggested it to me. apart from that to a layman you need to explain what he is eating at the store rather than tell him that it is milk. i know ice cream is made out of milk . overall ambience 1.5/5 dessert 3/5 staff 1/5', 2, timestamp '2019-06-03T01:07:46+0530', 36, 19003045),
(219, 'Nice place to have desert. It doesn''t server your usual kind of ice- cream, but it''s nice. I think it''s slightly expensive for what is being offered. The ambiance is also good.and comfortable.  Ambiance - 4 pricing - 3 Food -4', 4, timestamp '2019-05-27T03:50:05+0530', 214, 19003045),
(220, 'Sorry to say! But What an absolute DISAPPOINTMENT! To start off with the plating! Never seen a dessert more undelightful like the bingsu I ordered. The quality of desserts compared to the kormangala branch(now closed) has drastically fallen! The bingsu was all melted and looked so horrible that I didn''t want to scoop in at all. I couldn''t even hold the cup coz it was all watery or milky(you can see it in one of the pictures in timeline too lol) and for the taste. Lol the whipping cream was stale!! I could tell by the first spoon. And thanks for the froster didn''t know all it takes is just cold water+milk powder and any chocolate syrup and put a price tag ₹159 :) that one star is coz that''s the minimum I can give here! I have been a fan of snow ora since its beginning! Was such a regular! But this branch just spoilt everythinggg! I did! give this place a second chance but it just got more worse. I regret bringing my family and friends here because I wanted them to taste something Korean! But what a shame to the name. If you''re bringing a country!and representing a tradition then for god''s sake please respect them and meet the standards. Really don''t wnat any hate to the country. ', 1, timestamp '2019-05-26T09:56:02+0530', 215, 19003045),
(221, 'Delicious food served in matka''s ( Pots ) The food is cooked on the spot so it''s always fresh. Would recommend you to order online because it''s more of a cloud kitchen. Overall nice experience ️', 5, timestamp '2019-11-29T23:14:11+0530', 216, 19003076),
(222, 'Ordered food delivery— butter chicken and parantha— best North Indian chicken served in north Bangalore— will repeat !', 5, timestamp '2019-09-14T22:42:01+0530', 217, 19003076),
(223, 'Excellent service from taking the order to delivery. Taste and quality of the food is good. Ordered it online. Would definitely like to go there and try it out again.', 4, timestamp '2019-08-20T07:14:42+0530', 218, 19003076),
(224, 'Food was moderate, it is a tiny shop, very polite staff, biryani was ok, tasted more like northindian, not much of naati style. Chicken pakoda was rubbery, the chutney was super.', 3, timestamp '2019-07-19T09:57:52+0530', 219, 19003076),
(225, 'The quantity here is very less when you order. Please do not order online from this restaurant. Each of the items in the box is priced at 190Rs. But if you check the quantity it''s not worth. ', 1, timestamp '2019-06-30T14:07:20+0530', 220, 19003076),
(226, 'Different concept. Quite reasonable pricing wit tasty dishes and with good quantity. Must try -?Chhole Batura, handi chicken, chicken chatpata, veg chowmein abd chicken biryani. In fact I like most of the dishes here. Very good service. ', 5, timestamp '2019-06-02T03:03:12+0530', 221, 19003076),
(227, 'They display Dal on menu and along with it i ordered an another dish later i recieved a call that they arenot servng dal any more and hence to reorder smthing else as i already had pre paid the amount. They took 30 mins for prepration and overall fro delivery it was arnd and hour. Taste was not good n wasn''t fresh.', 1, timestamp '2019-05-17T10:24:58+0530', 222, 19003076),
(228, 'Nice ambience towards the road good place to visit Will be visiting again People are good Affordable pricing . ,. Hope to see this place again', 5, timestamp '2019-05-15T19:11:18+0530', 223, 19003076),
