(253, 'I ordered chicken meal from this place. Delivery time was very less. But what I was not expecting was the raw chicken that I got in chicken curry. It was very disappointing for me as I love chicken. The way it was cooked was shattering my heart and felt like I almost never want to eat chicken again. And I don''t know how I was supposed to eat chapati and rice with just the gravy. ', 1, timestamp '2019-07-11T18:23:13+0530', 248, 19003970),
