(256, 'This was my 3rd visit. My earlier two experience was still not great but manageable.   Since summer vacation, I was alone and was eating out daily. But writing this on the third visit.  Earlier visit I asked for dal they didn''t serve it but served dry veg. That too a waiting time of 15-20 minutes when there are 3 or 4 customers. I complained that to the cashier-cum-owner lady, maybe if she reads will remember. Another time I took the parcel and they put papad and onion on the same wrapper and the papad tuned to roti! It was the third time, I ordered their paneer-roti meal. I took a table, settled there, had taken water and sipping waiting for the food to be served. Meanwhile, a lady with two others came and requested me to leave that table and move to another place. I looked and the other two tables were already full of couples.  I looked at the waiter, he asked me to adjust on a different table with a couple.  I was like what, why to feel them uneasy. If this idiot waiter and the cashier would have some sense that I waited for food for 20 min, and ask me to hop over to eat. Sorry I am not that cheap, have some respect. I decided to move out, asked the waiter to cancel.  I left the place and was on the bike, the waiter asked me "kya hua", while someone from behind shouted "jaane do".', 1, timestamp '2019-05-04T21:12:52+0530', 251, 19003970),
