(266, 'Very worst service and cheated by zomato and giving wreckless answers. I have ordered food for Rs.435, they didnt deliver saying that my address was wrong. Previously i have ordered the food to the same location approx. 20 times. Now they are not giving money and i am going to sleep with my empty stomach. I will explain all these to my neighbourhood and friends and relaives to never order food from zomato. And also saying that you will not get that money back which i have spent rs.435/- for the order number 1132808906. I will suggest to not to buy food from zomato.', 1, timestamp '2019-08-10T23:05:20+0530', 261, 19004160),
