(269, 'Shettys lunch home. Not a fancy name 😅 but I must say fancy ambience for sure. This is a new place. This place has parking facility available. The restaurant has total 3 floors and you can choose as per your comfort . This place serves alcohol And the Staters here are good but most of them are spicy. So do mention before ordering if u need less spicy. The food here was good too. Coming to negatives. Service is fine but The staff here were not polite. As I have visited more than 4-5 times. N everytime, it''s the same. The staff has no patience . Major drawback is billing. As I check the bill wherever I go 😅. Out of my 5 times visit here i found wrong booking 3 times here. Like we use Zomato gold for drinks here and they discount the offer price and see the extra drink billed. So that was a major drawback here. They need to look after These petty issues 😊 . #justbengaluru_things', 3, timestamp '2019-09-30T22:34:15+0530', 264, 19004202),
