(275, 'I haven''t tasted the chicken ghee roast in Kundapur branch so i am not sure if it''s as good as people say about the kundapura one, but i loved the ghee roast here. Nice flavour of ghee cooked into the meat. Chicken was perfectly cooked and it was literally finger Licking good. I also had bangda and Kane fish fry, tawa and masala fry. Both were delicious. And at last we had the fish curry with rice , awesome curry. Best part was we didn''t feel bloated. Felt like a home made meal. I prefer spicy food so i loved the spice level. Service was excellent For me this is as good or better than maravanthe in Indiranagar. I would definitely recommend this to people.', 5, timestamp '2019-11-29T16:33:39+0530', 270, 19004202),
