(289, 'Just wanted to try some other Shwarma apart from just and absolute so tried this. I do like the taste of Shwarma but not that much and with that there was 1 chicken piece that was also the same with some "fika" taste. Mayonise was good Suggestion: add some more moyonise to your Shwarma and I think that will definitely develop some good taste. I want to try some other food as well and hope my ratings will go up. Thank you', 3, timestamp '2019-07-05T13:49:00+0530', 284, 19004515),
(290, 'I am surprised to see such good reviews for this new restaurant. I am from Chennai. During my visit to bangalore happened to walk into this restaurant and it was suggested by the an other restaurant guy near by while I was having my lunch. So I gave it a try on the same evening and trust me, it was of best taste. Usually when I am in bangalore I literally miss the chennai taste but this one is ultimately delicious. Restaurant owner was very friendly and was asking for our feedback on the food taste and quality. He also has plans to get the real South Indian Briyani to bangalore. Wishing him all the very best. ', 5, timestamp '2019-04-03T18:39:50+0530', 285, 19004515),
(291, 'Good quality and amazing taste. great place for food lovers. Do taste the awesome shawarma and the grill, superb tasty, please try this place for quality and tasty food ', 5, timestamp '2019-04-03T12:43:33+0530', 286, 19004515),
