(344, 'This hotel is newly opened. It serves wide variety of dosas and also normal breakfast items like rice bath and idly vada. It doesn''t have meals though. Must try items are: Bread roast dosa, open butter masala dosa, Akki rotti, Menthya dosa and shaavige Small place but best for the price. It is more like majaa tindi. Prices are not very high.', 4, timestamp '2020-01-05T08:55:22+0530', 339, 19006346),
(345, 'Bhattru hotel Today I visited this hotel with some friends the dishes which they prepare are awesome I really like it fully tasteful. ', 4, timestamp '2019-11-14T01:03:09+0530', 340, 19006346),
(346, 'The breakfast here is simple and tasty. Its safe to say one of the best in Vidhyaranyapura area. I had Idli, Upma, Pineapple Kesari Bath, Vogarne Avalaki, Menthiya Dosa and Filter coffee. Idli was soft with delicious chutney. Vogarne Avalaki is flat puffed rice served with curd, differently good. Menthiya Dosa is made with fenugreek seeds, which is healthy and tasty served with vegetable sagu, sambar and coconut chutney. Pineapple Kesari Bath and filter coffee were the highlighs. Bhattru Hotel is a Dhashani Style hotel with limited seating. Bhattru Hotel is maintained neatly and the staff is polite. I would definitely recommend Bhattru Hotel to all my fellow reviewers. ', 4, timestamp '2019-05-09T13:22:54+0530', 341, 19006346),
(347, '. previously it was very good place for breakfast . but now they changed their chefs so many things are not available which is there on menu card. taste also changed a lot . not maintaine hygiene . now don''t feel like going there . ', 1, timestamp '2019-05-01T00:04:14+0530', 342, 19006346),
