(355, 'This outlet is there in food court rmz mall yelahanka. Tried their egg rolls and lasuni chicken. Egg roll tasted ok not that good kind of. The cost of egg roll ₹70/- Lasuni chicken wasn’t good though. Chicken was so dry and rubber kind. Price ₹130/- Service -3/5 Taste 3/5 Quality-2.5/5 ', 3, timestamp '2019-04-22T13:22:20+0530', 350, 19006412),
(356, '➡ The restaurant looks great from outside and the menu is elaborate with lot of options. However most of the cuisines listed in the menu are not available when enquired! The ambience looks great however the food served is disappointing 😣 ➡ Finally out of whatever available, we decided to try Hyderabadi Chicken Biriyani (as only this was available in biryani) and egg burji. Biriyani rice was very cold with just two small chicken pieces. 👎 The chicken pieces in the biriyani were very bony and didn''t seem to be freshly prepared. Egg burji was also not great. ➡ We were highly upset with the food served and hence didn''t order anything else. The prices were high compared to the quantity served. I wouldn''t recommend anyone to dine here. A suggestion to the management is to quicken the service, better preparation of the food and make sure that at least most of the dishes listed in menu are available to be ordered. ', 2, timestamp '2019-09-21T15:45:36+0530', 351, 19006430),
(357, 'Please do not dare to order anything from this restaurant until and unless want to waste your money. Have ordered Chicken Biriyani with Chilli Chicken. But end up with disappointment. Literally, no taste. It feels like having basmati rice with salt and chilly powder. And chilly chicken also feels like boiled chicken with chilly sauce! Really have successfully wasted my Rs.150. This was MY first and last order from BABAI BIRYANI HOUSE.', 1, timestamp '2020-02-29T14:16:09+0530', 352, 19006500),
